import React from 'react'
import {useNavigate} from "react-router-dom";
import { useContext } from 'react';
import { AuthContext } from '../Context/AuthContext';

export default function Navbar() {
    const { token,settoken } = useContext(AuthContext);
    const navigate = useNavigate();

 const lol = ()=>{
    if(token){
      return 
      {
          <div>
              <button onClick={()=>navigate("/connexion")}>connexion</button>
              <button onClick={()=>navigate("/inscription")}>inscription</button>
              <button onClick={()=>navigate("/")}>accueil</button>
          </div>}
    }else{
      return
      <div>
              <button onClick={()=>navigate("/connexion")}>lol</button>
              <button onClick={()=>navigate("/inscription")}>lol</button>
              <button onClick={()=>navigate("/")}>lol</button>
          </div>
    }
 }
  return (
     <div>
        {lol}
     </div>
  )
}
